import { Link } from "react-router-dom";
import ContactsBook from './Contact-components/ContactsBook';
import Todo from './Todo-components/Todo';

const Home = () => {
    return (
        <div>
            <h1>Home</h1>
            <nav>
                <Link to="/">Home</Link> |{<br/>}
                <Link to="contacts">Contacts</Link>|{" "}
                <Link to="todo">Todo</Link>
            </nav>
        </div>
    );
};

export default Home;
